import React, { Component } from 'react'
import { Map, GoogleApiWrapper } from 'google-maps-react';
const mapStyles = {
    width: '100%',
    height: '100%'
  };



  export class MapView extends Component {


    render() {

     //console.log(this.props.data)
     const data = this.props.data;
      return (
        <div>
        <table>
      <thead>
        <tr>
            <th>S.No</th>
            <th>Bundesnetza gentur Number</th>
            <th>Company</th>
            <th>Type</th>
            <th>State</th>
            <th>Production Value (kW)</th>
            <th>Agg.Production (kW)</th>
        </tr>
      </thead>

      <tbody>
      {data.map((row, i)=>(
        <tr key={i}> 
          <td>{i+1}</td>
          <td>{row.bundesnetzagentur_number}</td>
          <td>{row.comapny_name}</td>
          <td>{row.type}</td>
          <td>{row.state}</td>
          <td>{row.production_value_kw}</td>
          <td>{row.aggregated_production_kw}</td>
        </tr>
        ))} 

      </tbody>
    </table>  
    </div>
      );
    }
  }

  export default GoogleApiWrapper({
    apiKey: 'AIzaSyDRCcfJVtzzqsrmB5NpU2pytpTEjNlUDUk&libraries'
  })(MapView);
